{
  "translationLines": [
    {
      "lineNumber": 233852,
      "originalJapaneseLine": "　あんまり強くなさそうだけど……",
      "translatedEnglishLine": "They don't seem very strong though..."
    },
    {
      "lineNumber": 233853,
      "originalJapaneseLine": "　色んな奴がいるんだなあ」",
      "translatedEnglishLine": "There sure are all kinds of folks."
    },
    {
      "lineNumber": 233854,
      "originalJapaneseLine": "「うはーっ、眩しい」",
      "translatedEnglishLine": "Whoa, it's so bright!"
    },
    {
      "lineNumber": 233855,
      "originalJapaneseLine": "暗い迷宮内から出たあなた達をまず迎えたのは、",
      "translatedEnglishLine": "What first greeted you when you stepped out of the dark labyrinth,"
    },
    {
      "lineNumber": 233856,
      "originalJapaneseLine": "外の明るい太陽の光だった。",
      "translatedEnglishLine": "was the bright sunlight outside."
    },
    {
      "lineNumber": 233857,
      "originalJapaneseLine": "「お、出て来たか。",
      "translatedEnglishLine": "\"Oh, you came out."
    },
    {
      "lineNumber": 233858,
      "originalJapaneseLine": "　遅ぇぞ、テメェら」",
      "translatedEnglishLine": "You're late, you bastards.\""
    },
    {
      "lineNumber": 233859,
      "originalJapaneseLine": "「その顔を見ると間に合ったようだね」",
      "translatedEnglishLine": "\"Judging by your faces, looks like you made it in time.\""
    },
    {
      "lineNumber": 233860,
      "originalJapaneseLine": "「はんっ！　ま、予選程度は",
      "translatedEnglishLine": "\"Hmph! Well, the preliminaries"
    },
    {
      "lineNumber": 233861,
      "originalJapaneseLine": "　楽々クリアしてもらわねぇと困るがな！」",
      "translatedEnglishLine": "should be a breeze for us, or else that'd be a problem!\""
    },
    {
      "lineNumber": 233862,
      "originalJapaneseLine": "「やるじゃーん、男の子」",
      "translatedEnglishLine": "\"Nice job, boy.\""
    },
    {
      "lineNumber": 233863,
      "originalJapaneseLine": "「やるじゃーん、二人とも」",
      "translatedEnglishLine": "\"Nice work, both of you.\""
    },
    {
      "lineNumber": 233864,
      "originalJapaneseLine": "「まあ、まずはおめでとう」",
      "translatedEnglishLine": "\"Well, first of all, congratulations.\""
    },
    {
      "lineNumber": 233865,
      "originalJapaneseLine": "「あ、あの、あのあの……",
      "translatedEnglishLine": "\"Uh, um, umm...\""
    },
    {
      "lineNumber": 233866,
      "originalJapaneseLine": "　ふ、二人ともおめでとう……」",
      "translatedEnglishLine": "W-well, congrats to both of you...\""
    },
    {
      "lineNumber": 233867,
      "originalJapaneseLine": "「へっへっへっ、これくらい楽勝楽勝！」",
      "translatedEnglishLine": "\"Heh heh heh, this much is a piece of cake!\""
    },
    {
      "lineNumber": 233868,
      "originalJapaneseLine": "「お待たせー。",
      "translatedEnglishLine": "\"Sorry to keep you waiting."
    },
    {
      "lineNumber": 233869,
      "originalJapaneseLine": "　皆が中に入っている間に、",
      "translatedEnglishLine": "While everyone was inside,"
    },
    {
      "lineNumber": 233870,
      "originalJapaneseLine": "　宿屋は取っておいたよー」",
      "translatedEnglishLine": "I went ahead and reserved the inn for us.\""
    },
    {
      "lineNumber": 233871,
      "originalJapaneseLine": "「全員揃ったら行こうねー」",
      "translatedEnglishLine": "\"Let's head out once everyone's here.\""
    },
    {
      "lineNumber": 233872,
      "originalJapaneseLine": "「えっと、まだ来てないのは……」",
      "translatedEnglishLine": "\"Um, who hasn't arrived yet...\""
    },
    {
      "lineNumber": 233873,
      "originalJapaneseLine": "「レリコフとヒーローだね」",
      "translatedEnglishLine": "\"That'd be Rerikofu and Hero.\""
    },
    {
      "lineNumber": 233874,
      "originalJapaneseLine": "「あいつら……",
      "translatedEnglishLine": "\"Those guys..."
    },
    {
      "lineNumber": 233875,
      "originalJapaneseLine": "　予選落ちすんじゃねーだろーな」",
      "translatedEnglishLine": "Don't tell me they flunked out in the preliminaries.\""
    },
    {
      "lineNumber": 233876,
      "originalJapaneseLine": "「……はあ」",
      "translatedEnglishLine": "\"...Sigh.\""
    },
    {
      "lineNumber": 233877,
      "originalJapaneseLine": "その後、予選締め切りギリギリで",
      "translatedEnglishLine": "After that, just before the preliminaries deadline,"
    },
    {
      "lineNumber": 233878,
      "originalJapaneseLine": "レリコフとヒーローもなんとか突破し、",
      "translatedEnglishLine": "Rerikofu and Hero somehow made it through,"
    },
    {
      "lineNumber": 233879,
      "originalJapaneseLine": "あなた達は宿屋に向かうこととなった。",
      "translatedEnglishLine": "and you all headed toward the inn."
    },
    {
      "lineNumber": 233880,
      "originalJapaneseLine": "あなた達は予選の行われた迷宮を離れ、",
      "translatedEnglishLine": "You left the labyrinth where the preliminaries were held,"
    },
    {
      "lineNumber": 233881,
      "originalJapaneseLine": "リセットの取った宿屋に入った。",
      "translatedEnglishLine": "and entered the inn that Reset had reserved."
    },
    {
      "lineNumber": 233882,
      "originalJapaneseLine": "部屋はとても広く、大きな窓を開けると",
      "translatedEnglishLine": "The room was very spacious, and opening the large windows"
    },
    {
      "lineNumber": 233883,
      "originalJapaneseLine": "風が吹き込む気持ちのいい部屋だった。",
      "translatedEnglishLine": "let in a pleasant breeze."
    },
    {
      "lineNumber": 233884,
      "originalJapaneseLine": "一行はあなたの部屋に集まって、",
      "translatedEnglishLine": "The group gathered in your room,"
    },
    {
      "lineNumber": 233885,
      "originalJapaneseLine": "昼食を取っていた。",
      "translatedEnglishLine": "having lunch together."
    },
    {
      "lineNumber": 233886,
      "originalJapaneseLine": "「んぐんぐ……",
      "translatedEnglishLine": "\"Mmmnngh...\""
    },
    {
      "lineNumber": 233887,
      "originalJapaneseLine": "　しっかし、いい部屋借りたっすねー。",
      "translatedEnglishLine": "Man, you rented a really nice room."
    },
    {
      "lineNumber": 233888,
      "originalJapaneseLine": "　高かったんじゃないっすか？」",
      "translatedEnglishLine": "Wasn't it expensive?"
    },
    {
      "lineNumber": 233889,
      "originalJapaneseLine": "「闘神都市で一番いいお部屋だって」",
      "translatedEnglishLine": "\"It's the best room in Fighting God City, they say.\""
    },
    {
      "lineNumber": 233890,
      "originalJapaneseLine": "「ぶふっ！　マジすか！？」",
      "translatedEnglishLine": "\"Pfft! Seriously!?"
    },
    {
      "lineNumber": 233891,
      "originalJapaneseLine": "「今回はずっと戦うことになるから、",
      "translatedEnglishLine": "\"Since we'll be fighting continuously this time,"
    },
    {
      "lineNumber": 233892,
      "originalJapaneseLine": "　一番いい宿屋取ってこいってザンスちゃんが」",
      "translatedEnglishLine": "Zansu-chan told me to get the best inn.\""
    },
    {
      "lineNumber": 233893,
      "originalJapaneseLine": "「一回戦は明日からだから、",
      "translatedEnglishLine": "\"The first round starts tomorrow,"
    },
    {
      "lineNumber": 233894,
      "originalJapaneseLine": "　参加する子もいるかもだし、",
      "translatedEnglishLine": "and since some might still join,"
    },
    {
      "lineNumber": 233895,
      "originalJapaneseLine": "　今日はゆーっくり休もうね」",
      "translatedEnglishLine": "let's take it easy and rest today.\""
    },
    {
      "lineNumber": 233896,
      "originalJapaneseLine": "「がははは、宿屋ごと貸し切ってやったぜ」",
      "translatedEnglishLine": "\"Gahaha, I rented out the entire inn for us.\""
    },
    {
      "lineNumber": 233897,
      "originalJapaneseLine": "「さすが世界一金持ちな国の王子は",
      "translatedEnglishLine": "\"As expected of the prince from the richest country in the world,"
    },
    {
      "lineNumber": 233898,
      "originalJapaneseLine": "　やることが違う……」",
      "translatedEnglishLine": "you do things differently...\""
    },
    {
      "lineNumber": 233899,
      "originalJapaneseLine": "「しかし、これでほぼ全員が予選突破か」",
      "translatedEnglishLine": "\"But now, almost everyone has cleared the preliminaries.\""
    },
    {
      "lineNumber": 233900,
      "originalJapaneseLine": "「ま！　こんなとこで躓くわけねーわなー！」",
      "translatedEnglishLine": "\"Ha! There's no way we'd stumble here!\""
    },
    {
      "lineNumber": 233901,
      "originalJapaneseLine": "「なあ、ロッキー？」",
      "translatedEnglishLine": "\"Hey, Rocky?\""
    },
    {
      "lineNumber": 233902,
      "originalJapaneseLine": "「ぐすっ、ぐすっ……",
      "translatedEnglishLine": "\"Sniff, sniff..."
    },
    {
      "lineNumber": 233903,
      "originalJapaneseLine": "　おらも役に立ちたかっただすが、",
      "translatedEnglishLine": "I wanted to be useful too,"
    },
    {
      "lineNumber": 233904,
      "originalJapaneseLine": "　負けちゃっただす……」",
      "translatedEnglishLine": "but I ended up losing...\""
    },
    {
      "lineNumber": 233905,
      "originalJapaneseLine": "「がははは！　参加費の借金は",
      "translatedEnglishLine": "\"Gahaha! We'll be making you pay back that entry fee debt"
    },
    {
      "lineNumber": 233906,
      "originalJapaneseLine": "　きーっちり返してもらうからな！」",
      "translatedEnglishLine": "nice and proper!\""
    },
    {
      "lineNumber": 233907,
      "originalJapaneseLine": "「うう……」",
      "translatedEnglishLine": "\"Ugh...\""
    },
    {
      "lineNumber": 233908,
      "originalJapaneseLine": "「はあ……意地悪するんじゃないの」",
      "translatedEnglishLine": "\"Sigh... don't be so mean.\""
    },
    {
      "lineNumber": 233909,
      "originalJapaneseLine": "「みんなみんな、大変ー」",
      "translatedEnglishLine": "\"Everybody, everybody, there's trouble!\""
    },
    {
      "lineNumber": 233910,
      "originalJapaneseLine": "「受付でトーナメント表が発表されたって。",
      "translatedEnglishLine": "\"They announced the tournament brackets at the reception."
    },
    {
      "lineNumber": 233911,
      "originalJapaneseLine": "　行ってみようぜー」",
      "translatedEnglishLine": "Let's go check it out!\""
    }
  ]
}

